import LogItem from "./LogItem/LogItem";
import './Logs.css';
import Card from "./UI/Card/Card";

// 日志的容器
const Logs = () => {
        // {/* 模拟一组从服务器中加载的数据 */}
        const logsData = [
            {
                id: '001',
                date: new Date(2021, 10, 12, 19, 0),
                desc: '学习HTML + CSS',
                time: 40
            },
            {
                id: '002',
                date: new Date(2021, 12, 24, 15, 0),
                desc: '学习JavaScripts',
                time: 60
            },
            {
                id: '003',
                date: new Date(2022, 3, 8, 8,30),
                desc: '学习微信小程序',
                time: 50
            },
            {
                id: '004',
                date: new Date(2022, 4, 5, 1,20),
                desc: '学习React',
                time: 90
            },
            
        ];
        // {/* 将数据放入JSX中 */}
        const logItemDate = logsData.map(item => <LogItem key={item.id} date={item.date} desc={item.desc} time={item.time}/>);

        return <Card className="logs">
            {
                logItemDate
            }
        </Card>
};
export default Logs;
